function App() {
  const date = new Date();
  const hrs = date.getHours();
  const greeting = function () {
    if (hrs < 12) {
      return "Goodmorning";
    }
  };
  return (
    <>
      <h1>Hellow,{hrs < 12 ? "Good Morning" : "Good Afternoon"}</h1>
    </>
  );
}

export default App;
